void printSet(Set<String> journalnodes) {
  StringBuilder buffer = new StringBuilder();

  for (String journalnode : journalnodes) {
    if (buffer.length() > 0) {
      buffer.append(" ");
    }
    buffer.append(journalnode);
  }
  printOut(buffer.toString());
}
